import React from 'react';
import './SideBar.css';
import Menu from './Menu';
import { useSelector, useDispatch } from 'react-redux';

const SideBar = () => {
  const dispatch = useDispatch();
  const sideBarMenuList = useSelector((state) => state.sideBarMenuList);

 const updateSideBarMenu = (newMenuList) => {
    dispatch({ type: 'SET_SIDEBAR_MENU', payload: newMenuList });
  };

  return (
    <div className="sidebar">
      <Menu list={sideBarMenuList} />
    </div>
  );
};

export default SideBar;
